export default function loadView(view) {
  var fixView = view.substring(view.indexOf('/') + 1);

  switch (view.substring(0, view.indexOf('/'))) {
    case '@eladmin':
      console.log('--loadViewloadView------', view.substring(view.indexOf('/') + 1));
      return function (resolve) {
        return require(["@eladmin/views/".concat(fixView)], resolve);
      };

    case '@system':
      return function (resolve) {
        return require(["@system/views/system/".concat(fixView)], resolve);
      };

    case '@datasource':
      return function (resolve) {
        return require(["@datasource/views/datasources/".concat(fixView)], resolve);
      };

    case '@indicator':
      //console.log('--@@@@@@@@#====',(resolve) => require([`./views/indicators/${fixView}`], resolve))
      return function (resolve) {
        return require(["./views/indicators/".concat(fixView)], resolve);
      };

    /*case '@work':
      console.log('--loadViewloadView=========',view.substring(view.indexOf('/') + 1))
      //console.log('--##########====',(resolve) => require([`./views/wf/${fixView}`], resolve))
      return (resolve) => require([`./views/work/${fixView}`], resolve)*/

    case '@workflow':
      return function (resolve) {
        return require(["@workflow/views/activiti/".concat(fixView)], resolve);
      };

    default:
      return function (resolve) {
        return require(["@/views/".concat(view)], resolve);
      };
  }
}
